import React from 'react';
import Covid_Pic from '../asset/image/covid_19.png';
const Third_Main = () => {
  return (
    <div>
      <img src={Covid_Pic} alt='Covid_Pic' style={{ width: '150px' }} />
    </div>
  );
};

export default Third_Main;
